  return (
    <div>
      <nav className="navbar">
        <div className="navbar-brand">
          <img src="/li.jpg.png" alt="Health&me logo" className="logo" />
        </div>
        <div className="navbar-links">
          <Link to="/" className={location.pathname === '/' ? 'active' : ''}>Home</Link>
          <Link to="/dashboard" className={location.pathname === '/dashboard' ? 'active' : ''}>Dashboard</Link>
          <Link to="/data-collection" className={location.pathname === '/data-collection' ? 'active' : ''}>Data Collection</Link>
          <Link to="/ai-analysis" className={location.pathname === '/ai-analysis' ? 'active' : ''}>AI Analysis</Link>
          <Link to="/AlertsReports" className={location.pathname === '/ALertsReports' ? 'active' : ''}>Alerts and Reports</Link>
          <Link to="/User" className={location.pathname === '/User' ? 'active' : ''}>User Management</Link>
          <button className={`profile-btn ${location.pathname.toLowerCase() === '/profile' ? 'active' : ''}`} onClick={onProfileClick}>
            Profile
          </button>
        </div>
      </nav>
    </div>
  );
};
};

export default Navbar;
